import React from "react";
import { ArtistType } from "./ArtistLookup";
import SearchItem from "./SearchItem";
import { Dropdown } from "react-bootstrap";

interface BootstrapDropdownProps {
    searchResults: Array<ArtistType>;
    onArtistChange: (artist: string) => void;
}

const BootStrapDropdown = (props: BootstrapDropdownProps) => {
    return(
       <Dropdown>
            <Dropdown.Menu>
                {props.searchResults.map((artist, index) => {
                    return(
                        <Dropdown.Item>
                            <SearchItem artist={artist} key={index} onArtistChange={props.onArtistChange}/>
                        </Dropdown.Item>
                    );
                }
                )}
            </Dropdown.Menu>
       </Dropdown>
    );
}
export default BootStrapDropdown;
